Sam es un fotgrafo, emprendedor y surfista basado en las Islas Canarias. El compr su primera cmara (un Nikon DSLR) cuando tena 21 aos y encontr su pasin por la fotografa mientras viajaba por Asia, Amrica Latina y Europa. A menudo viajando solo, la cmara era su mejor compaera de viaje y sacaba todo lo que captaba su atencin durante sus viajes.

Sam suele sacar su cmara cuando las olas son demasiado grandes. Le encanta tomar fotografas espontneas de surfistas, paisajes, playas, atardeceres y todo lo relacionado con el ocano.

